/\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2392010","type":"CustomJS"},{"attributes":{},"id":"2391613","type":"LinearScale"},{"attributes":{"axis":{"id":"2391619"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"2391622","type":"Grid"},{"attributes":{"line_alpha":{"value":0.2},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"2391904","type":"Segment"},{"attributes":{"data":{"Close":{"__ndarray__":"+1xtxf5CVkByio7k8iNWQDMzMzMzM1ZAxm00gLcIVkApyxDHuvxVQCntDb4wuVVAwcqhRbbLVUDl8h/SbwtWQPMf0m9fO1ZAodY07zghVkCY3ZOHhRJWQIj029eB21VAI0p7gy/8VUAr9pfdkytWQKHWNO84IVZA2c73U+NNVkARx7q4jXpWQGKh1jTvbFZApb3BFyZXVkD2l92Th0lWQOjZrPpcQVZAyxDHurhFVkBbQj7o2ShWQNCzWfW5glVAzojS3uBTVUDBqKROQI9VQMdLN4lBzFVAAd4CCYrDVUDJ5T+k35ZVQHGsi9toYFVAWYY41sUhVUD129eBc0JVQMWPMXctRVVA001iEFhNVUCx4emVspRVQDtwzojSulVACyQofoy9VUAp7Q2+MLlVQMdLN4lBzFVAukkMAivLVUD0/dR46X5VQPAWSFD8SFVAldQJaCIgVUCV1AloIqBUQIQNT6+UpVRAWYY41sWhVECKjuTyHyZUQAg9m1Wfh1RARdjw9EpxVECKjuTyH6ZUQEI+6NmsplRAKe0NvjC5VEC94xQdyRVVQJXUCWgiIFVAtMh2vp9KVUBlqmBUUl9VQF8pyxDH3lVAIo51cRv1VUBtxf6yeypWQHZPHhZqHVZA8fRKWYYMVkDiWBe30UBWQLG/7J48WFZAj1N0JJefVkDLEMe6uMVWQFHaG3xh8lVAm1Wfq60gVkAXSFD8GHtWQMzuycNCiVZAhxbZzveXVkB90LNZ9Z1WQF8HzhlRolZA1CtlGeKQVkCxv+yePNhWQEp7gy9MrlZAfoy5awmlVkBGtvP91LRWQN5xio7kCldASL99HTgnV0Cyne+nxhtXQCZTBaOS7lZAhxbZzvcXV0BLWYY41vFWQJtVn6utIFdAYqHWNO9sV0DQs1n1uYJXQBHHuriNeldAOdbFbTRwV0C7Jw8LtY5XQAtGJXUCeldAmN2Th4WSV0CV1AloIqBXQJAxdy0h41dAseHplbIUWEA4+MJkqixYQKwcWmQ7G1hAHcnlP6
